import React from 'react';

// 导入antd
import { Button } from 'antd';
import 'antd/dist/antd.css';

class Title extends React.Component {
    constructor() {
        super(...arguments);
        this.state = {
            buttonName: '点击改变标题名称',
        };
    }

    handleChange = () => {
        console.log(this.props.titleName);
    }

    render() {
        return (
            <div className="title">
                <h1 className="titleName">欢迎来到{this.props.titleName}</h1>
                <Button type="primary">{this.state.buttonName}</Button>
            </div>
        );
    }
}

export default Title;
